noBB_folders = ['', 'group0/', 'group1/', 'group2/', 'group3/', 'group4/']

def writePic():


    for folder in noBB_folders:
        folder_path = noBB_base_dirs + folder
        if not os.path.exists(folder_path):
            os.makedirs(folder_path)

    for file in file_list:
        save_path = file[0]
        img_str = file[1]
        print(save_path, img_str)
        img_data = base64.b64decode(img_str)
        with open(save_path, 'wb') as f:
            f.write(img_data)

writePic()



